Dating in the Dark is a unique alternative series that asks the age-old question, &quot;Is Love Blind?&quot; Each week, three single men and three single women, all looking for love, will move into a house together, but be totally sequestered from the opposite sex. While they will have no chance of seeing each other in the light, they will have the opportunity to date in a completely dark room. Looks will be taken out of the equation as the men and women get to know each other and form bonds in total darkness. After several days of dating in the darkroom, the participants will select the one member of the opposite sex that they want to see revealed in the light. For the first time, the participants will see whom they've been dating, wooing, kissing, snuggling with and forming bonds with. And after they see each other in the light for the first time, they have to make the difficult decision...do they stay with the person they fell for in the dark, or leave them behind? 

